import React, { useEffect } from "react";
import { connect } from "react-redux";

import { fetchDoor } from "../../actions";

const DoorsEdit = ({ fetchDoor }) => {
  useEffect(() => {});
  return (
    <React.Fragment>
      <h2>DoorsEdit</h2>
    </React.Fragment>
  );
};

export default connect(null, { fetchDoor })(DoorsEdit);
